import React from 'react';
import { MapPin, Phone, Mail, Sparkles } from 'lucide-react';
import { useIntersectionObserver } from '../hooks/useIntersectionObserver';

const Contact = () => {
  const [ref1, isVisible1] = useIntersectionObserver({ threshold: 0.2 });
  const [ref2, isVisible2] = useIntersectionObserver({ threshold: 0.2 });
  const [ref3, isVisible3] = useIntersectionObserver({ threshold: 0.2 });
  const [ref4, isVisible4] = useIntersectionObserver({ threshold: 0.2 });

  return (
    <section className="py-20 bg-gradient-to-b from-purple-50 to-pink-50 relative overflow-hidden">
      {/* Fondos flotantes */}
      <div className="absolute top-20 left-10 w-72 h-72 bg-purple-200/30 rounded-full blur-3xl animate-float"></div>
      <div className="absolute bottom-20 right-10 w-72 h-72 bg-pink-200/30 rounded-full blur-3xl animate-float-delayed"></div>

      <div className="container mx-auto px-4 relative z-10">
        {/* Título */}
        <div className={`text-center mb-16 ${isVisible1 ? 'animate-fade-in-up' : 'opacity-0'}`} ref={ref1}>
          <h2 className="text-5xl md:text-6xl font-bold text-purple-800 mb-6">
            Contáctanos
          </h2>
          <p className="text-xl md:text-2xl text-purple-700 max-w-2xl mx-auto">
            ¿Tienes alguna pregunta? Estamos aquí para ayudarte
          </p>
        </div>

        {/* Información centrada con fade-in individual */}
        <div className="flex flex-col items-center gap-6">
          <div
            ref={ref2}
            className={`flex items-center gap-4 p-6 bg-purple-100 rounded-2xl shadow-lg transition-all duration-700 ${isVisible2 ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'}`}
          >
            <div className="bg-purple-300 p-3 rounded-xl shadow-lg">
              <MapPin className="text-white" size={24} />
            </div>
            <div>
              <h3 className="text-xl font-bold text-purple-800 mb-1 text-center">Ubicación</h3>
              <p className="text-purple-700 text-center">Av. Principal 1234, Buenos Aires, Argentina</p>
            </div>
          </div>

          <div
            ref={ref3}
            className={`flex items-center gap-4 p-6 bg-pink-100 rounded-2xl shadow-lg transition-all duration-700 delay-100 ${isVisible3 ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'}`}
          >
            <div className="bg-pink-300 p-3 rounded-xl shadow-lg">
              <Phone className="text-white" size={24} />
            </div>
            <div>
              <h3 className="text-xl font-bold text-purple-800 mb-1 text-center">Teléfono</h3>
              <p className="text-purple-700 text-center">+54 11 1234-5678</p>
            </div>
          </div>

          <div
            ref={ref4}
            className={`flex items-center gap-4 p-6 bg-orange-100 rounded-2xl shadow-lg transition-all duration-700 delay-200 ${isVisible4 ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'}`}
          >
            <div className="bg-orange-300 p-3 rounded-xl shadow-lg">
              <Mail className="text-white" size={24} />
            </div>
            <div>
              <h3 className="text-xl font-bold text-purple-800 mb-1 text-center">Email</h3>
              <p className="text-purple-700 text-center">contacto@MiTienda.com</p>
            </div>
          </div>

          {/* Horarios */}
          <div
            ref={ref4}
            className={`p-6 bg-purple-200 rounded-2xl text-purple-800 shadow-lg text-center transition-all duration-700 delay-300 ${isVisible4 ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'}`}
          >
            <h3 className="text-2xl font-bold mb-2 flex items-center justify-center gap-2">
              <Sparkles size={24} />
              Horarios de Atención
            </h3>
            <div className="space-y-1 text-lg">
              <p>Lunes a Viernes: 9:00 - 20:00</p>
              <p>Sábados: 10:00 - 18:00</p>
              <p>Domingos: Cerrado</p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
